import numpy as np
import time

debug = True

"""![image.png](data:image/png;base64,)

"""

# Bit-Reversal for a given array
# [a   b   c   d   e   f   g   h] -> 000 001 010 011 100 101 110 111
# [a   c   e   g] [b   d   f   h]
# [a   e] [c   g] [b   f] [d   h] -> 000 100 010 110 001 101 011 111
#
def bit_reverse_copy(a):
    n = len(a)
    rev = np.zeros(n, dtype=np.complex128)

    # calculate number of bits needed
    num_bits = int(np.log2(n))

    # find reversed index for each element and assign accordingly
    for i in range(n):
        # Reverse the bits of i
        reversed_i = 0
        for j in range(num_bits):
            if i & (1 << j):
                reversed_i |= 1 << (num_bits - 1 - j)
        rev[reversed_i] = a[i]

    if debug and False:
        print(f"Original: {a} -> Reversed: {rev}")
    return rev

"""![image.png](data:image/png;base64,)

"""

# Cooley-Tukey FFT algorithm - DIT approach with bit-reversal
def fft_cpu(x):

    n = len(x)

    # check if n is a power of 2
    if n % 2 != 0:
        raise ValueError(f"Sequence length is {n}, must be a power of 2")

    # bit-reverse the sequence
    x = bit_reverse_copy(x)

    # compute number of stages for FFT divide-and-conquer
    num_stages = int(np.log2(n))
    if debug:
        print(f"Sequence length: {n}, Number of FFT stages: {num_stages}")

    # iterate through each stage
    for stage in range(1, num_stages + 1):
        # Size of FFT at this stage (2, 4, 8, 16, ...)
        m = 2 ** stage
        half_m = m // 2
        if debug:
            print(f"Stage: {stage}, DFT size: {m}, Groups: {(n // m)}")
        # Twiddle factor: e^(-2Ï€i/m)
        w_m = np.exp(-2j * np.pi / m)

        # Process each group
        for k in range(0, n, m):
            w = 1.0 + 0j  # Initialize twiddle factor

            # Butterfly operations within the group
            for j in range(half_m):
                # Indices for butterfly
                t = w * x[k + j + half_m]
                u = x[k + j]

                # Butterfly computation
                x[k + j] = u + t
                x[k + j + half_m] = u - t

                # Update twiddle factor
                w *= w_m
    return x

def run_fft():

    # Test sizes
    test_sizes = [32, 4096]

    for n in test_sizes:
        print(f"Testing FFT on CPU - Sequence length {n}")
        print("=" * 60)
        # generate random complex input
        x = np.random.randn(n) + 1j * np.random.randn(n)

        # CPU FFT
        start = time.time()
        result_myver = fft_cpu(x.copy())
        time_myver = time.time() - start

        # Reference FFT (NumPy)
        start = time.time()
        result_ref = np.fft.fft(x)
        time_ref = time.time() - start

        # Calculate error
        error = np.max(np.abs(result_myver - result_ref))

        print(f"\nSize: {n}")
        print(f"  CPU FFT time: {time_myver*1000:.2f} ms")
        print(f"  Ref FFT time: {time_ref*1000:.2f} ms")
        print(f"  Error:        {error:.2e}\n")

    return

if __name__ == "__main__":
    run_fft()

    # Example usage
    print("\n" + "=" * 60)
    print("Example: FFT of a simple signal")
    print("=" * 60)

    # Create a simple signal: sum of two sinusoids
    n = 64
    t = np.arange(n)
    signal = np.sin(2 * np.pi * 5 * t / n) + 0.5 * np.sin(2 * np.pi * 10 * t / n)

    # Compute FFT
    fft_result = fft_cpu(signal.astype(np.complex128))

    # Get magnitude spectrum
    magnitude = np.abs(fft_result)

    print(f"\nPeak frequencies detected at bins: {np.argsort(magnitude)[-3:][::-1]}")
    print("(Expected peaks at bins 5 and 10)")